import React, { Component } from 'react';

class Footer extends Component {
  render() {
    return (
        <footer id="footer">
        <div class="footer-top">
          <div class="container">
    
          </div>
        </div>
    
        <div class="container">
          <div class="copyright">
            &copy; Copyright <strong>Jeoh Garche IT2C</strong>. All Rights Reserved
          </div>
        </div>
      </footer>
      
    );
  }
}
export default Footer;
